import React, { Component } from 'react'
import './Register.css'

class Register extends Component {
    state = {
        inputFirstName: '',
        inputLastName: '',
        inputEmail: '',
        inputPassword: ''
    }

    onRegisterClick = () => {
        console.log(this.state)
    }

    render() {
        return (
            <div className="container">
                <div className="card-register container">
                    <p className="title-ku"> Create Account </p>
                    <label htmlFor="firstName"> First Name </label>
                    <input onChange={(e) => {this.setState({inputFirstName: e.target.value})}} placeholder="First Name" id="firstName" type="text"/>
                    <label htmlFor="lastName"> Last Name </label>
                    <input onChange={(e) => {this.setState({inputLastName: e.target.value})}} placeholder="Last Name" id="lastName" type="text"/>
                    <label htmlFor="email"> Email </label>
                    <input onChange={(e) => {this.setState({inputEmail: e.target.value})}} placeholder="Email" id="email" type="email"/>
                    <label htmlFor="password"> Password </label>
                    <input onChange={(e) => {this.setState({inputPassword: e.target.value})}} placeholder="Password" id="password" type="password"/>
                    <button onClick={this.onRegisterClick} className="button-ku"> Create Account </button>
                </div>
            </div>
        )
    }
}

export default Register
